import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from './components/Home';
import SiparisFormu from './components/OrderPage';
import SiparisOnayi from './components/Success';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/"><Home/></Route>
        <Route path="/order-page"><SiparisFormu/></Route> 
        <Route path="/siparis-alindi"><SiparisOnayi/></Route>
      </Switch>
    </Router>
  );
};

export default App;
